import './index.css';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <CartProvider>

      <BrowserRouter>

          <App />


      </BrowserRouter>

    </CartProvider>
  </React.StrictMode>,
  document.getElementById('root')
);

